import './topic-list.css'
const TopicList=({list})=>{
    let count=0
    const elements=list.map(item=>{
        const {id,...itemProps}=item
        console.log(item)
        return (
        
            <div className="navItem" key={item.icon}>
                 {item.category}
            </div>
        )
    })
    return(
        
    <div>
             {elements} 
    </div>
       
    )

}
export default TopicList
